// Name: TOTP Generator
// ID: saaf4totpgenerator
// Description: A TOTP generator that takes a BASE32 secret key and outputs a token.
// By: SAAf44 <https://scratch.mit.edu/users/SAAf44/>

class TOTPGeneratorExtension {
  getInfo() {
    return {
      id: 'saaf44totpgenerator',
      name: 'TOTP Generator',
      color1: '#3F51B5',
      color2: '#303F9F',
      color3: '#FFFFFF',
      menuIconURI: 'data:image/png;base64,',
      blocks: [
        {
          opcode: 'generateTOTP',
          blockType: Scratch.BlockType.REPORTER,
          text: 'generate TOTP from [SECRET] every [PERIOD]s with [DIGITS] digits',
          arguments: {
            SECRET: {
              type: Scratch.ArgumentType.STRING,
              defaultValue: 'JBSWY3DPEHPK3PXP'
            },
            PERIOD: {
              type: Scratch.ArgumentType.NUMBER,
              defaultValue: 30
            },
            DIGITS: {
              type: Scratch.ArgumentType.NUMBER,
              defaultValue: 6
            }
          }
        },
        {
          opcode: 'timeLeft',
          blockType: Scratch.BlockType.REPORTER,
          text: 'time left for [PERIOD]s token',
          arguments: {
            PERIOD: {
              type: Scratch.ArgumentType.NUMBER,
              defaultValue: 30
            }
          }
        }
      ]
    };
  }


  // Base32 -> Uint8Array
  base32ToBytes(base32) {
    const alphabet = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ234567';
    let bits = '';
    const bytes = [];


    base32 = (base32 || '').replace(/=+$/, '').toUpperCase();
    for (let i = 0; i < base32.length; i++) {
      const val = alphabet.indexOf(base32[i]);
      if (val === -1) throw new Error('Invalid base32 character: ' + base32[i]);
      bits += val.toString(2).padStart(5, '0');
    }
    for (let i = 0; i + 8 <= bits.length; i += 8) {
      bytes.push(parseInt(bits.substring(i, i + 8), 2));
    }
    return new Uint8Array(bytes);
  }


  // HMAC-SHA1 via Web Crypto; counter is a Number
  async hmacSha1(keyBytes, counter) {
    const cryptoKey = await crypto.subtle.importKey(
      'raw',
      keyBytes.buffer || keyBytes,
      { name: 'HMAC', hash: 'SHA-1' },
      false,
      ['sign']
    );


    const counterBuffer = new ArrayBuffer(8);
    const counterView = new DataView(counterBuffer);
    // big-endian: high 32 bits (usually 0), low 32 bits = counter
    const high = Math.floor(counter / 0x100000000);
    const low = counter >>> 0;
    counterView.setUint32(0, high, false);
    counterView.setUint32(4, low, false);


    const signature = await crypto.subtle.sign('HMAC', cryptoKey, counterBuffer);
    return new Uint8Array(signature);
  }


  // async reporter (returns a Promise)
  async generateTOTP(args) {
    try {
      const secret = (args.SECRET || '').trim();
      const period = Math.max(1, Number(args.PERIOD) || 30);
      const digits = Math.max(1, Math.min(10, Number(args.DIGITS) || 6));


      const keyBytes = this.base32ToBytes(secret);
      const counter = Math.floor(Date.now() / 1000 / period);


      const hmac = await this.hmacSha1(keyBytes, counter);


      const offset = hmac[hmac.length - 1] & 0xf;
      const binary =
        ((hmac[offset] & 0x7f) << 24) |
        ((hmac[offset + 1] & 0xff) << 16) |
        ((hmac[offset + 2] & 0xff) << 8) |
        (hmac[offset + 3] & 0xff);


      const otp = (binary % Math.pow(10, digits)).toString().padStart(digits, '0');
      return otp;
    } catch (e) {
      return 'Error';
    }
  }


  // synchronous reporter for time left
  timeLeft(args) {
    const period = Math.max(1, Number(args.PERIOD) || 30);
    const now = Math.floor(Date.now() / 1000);
    return period - (now % period);
  }
}


Scratch.extensions.register(new TOTPGeneratorExtension());
